import React from 'react';
import Card from '../UI/Card';
import './style.css';

const BlogPost=props=>{
    return(
      <div className="blogPostContainer">
        <Card>
            <span>Featured</span>
            <h1>Beautiful is always beautiful</h1>
        </Card>
      </div>
    );
}

export default BlogPost;
